/*View structure for view creditosalunos */

/*!50001 DROP TABLE IF EXISTS `creditosalunos` */;
/*!50001 DROP VIEW IF EXISTS `creditosalunos` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `creditosalunos` AS (select `e`.`nome` AS `nome`,sum(`d`.`credito`) AS `creditos`,`c`.`nomecurso` AS `nomeCurso` from (((((((`mediasparticipacao` `m` join `porcentegemfalta` `p` on((`m`.`codPart` = `p`.`codPart`))) join `participacao` `a` on((`p`.`codPart` = `a`.`codPart`))) join `pessoa` `e` on((`a`.`codAluno` = `e`.`codPessoa`))) join `turma` `t` on((`t`.`codTurma` = `a`.`codTurma`))) join `disciplina` `d` on((`t`.`codDisciplina` = `d`.`codDisciplina`))) join `cursodisciplina` `cd` on((`d`.`codDisciplina` = `cd`.`codDisciplina`))) join `curso` `c` on((`cd`.`codCurso` = `c`.`codCurso`))) where ((`p`.`porcent` <= 25) and (`m`.`media` >= 60)) group by `a`.`codAluno`) */;

/*View structure for view maioresmedias */

/*!50001 DROP TABLE IF EXISTS `maioresmedias` */;
/*!50001 DROP VIEW IF EXISTS `maioresmedias` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `maioresmedias` AS (select `e`.`nome` AS `nome`,avg(`ap`.`nota`) AS `media` from ((`participacao` `p` join `avaliacaopart` `ap` on((`p`.`codPart` = `ap`.`codPart`))) join `pessoa` `e` on((`e`.`codPessoa` = `p`.`codAluno`))) group by `p`.`codAluno` order by avg(`ap`.`nota`) desc limit 3) */;

/*View structure for view mediasparticipacao */

/*!50001 DROP TABLE IF EXISTS `mediasparticipacao` */;
/*!50001 DROP VIEW IF EXISTS `mediasparticipacao` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `mediasparticipacao` AS (select `p`.`codPart` AS `codPart`,sum(((`ap`.`nota` * `a`.`peso`) / 100)) AS `media` from ((`participacao` `p` join `avaliacaopart` `ap` on((`p`.`codPart` = `ap`.`codPart`))) join `avaliacao` `a` on((`ap`.`codAvaliacao` = `a`.`codAvaliacao`))) group by `p`.`codPart`) */;

/*View structure for view porcentegemfalta */

/*!50001 DROP TABLE IF EXISTS `porcentegemfalta` */;
/*!50001 DROP VIEW IF EXISTS `porcentegemfalta` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `porcentegemfalta` AS (select `a`.`codPart` AS `codPart`,((sum(`r`.`falta`) * 100) / (count(`a`.`codPart`) * 2)) AS `porcent` from (`participacao` `a` join `presenca` `r` on((`a`.`codPart` = `r`.`codPart`))) group by `a`.`codPart`) */;

/*View structure for view professoresalunofalta */

/*!50001 DROP TABLE IF EXISTS `professoresalunofalta` */;
/*!50001 DROP VIEW IF EXISTS `professoresalunofalta` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `professoresalunofalta` AS (select `p`.`nome` AS `Aluno`,`pf`.`nome` AS `Professor`,sum(`r`.`falta`) AS `faltas` from ((((`pessoa` `p` join `participacao` `a` on((`p`.`codPessoa` = `a`.`codAluno`))) join `presenca` `r` on((`a`.`codPart` = `r`.`codPart`))) join `turma` `t` on((`t`.`codTurma` = `a`.`codTurma`))) join `pessoa` `pf` on((`t`.`codProf` = `pf`.`codPessoa`))) group by `t`.`codProf`,`a`.`codAluno`) */;

